import React from 'react';
// import logo from './logo.svg';
import './App.css';
import Header from './Head';
import Main from './main';
import Footer from './Footer';


function App() {
  return (
    <div className="App">
      <Header/>
      <Main/>
      <Footer/>
    </div>
  );
}

export default App;
